$(function () {
    var func = function(data) {
        $("#anim").html("<img src='data:image/jpg;base64," + data.img + "'/>");
    }
    var query1 = new _ch.AjaxWidget(func, {url: "http://test/angular.png", methodType: "GET"});
    var query2 = new _ch.AjaxWidget(func, {url: "http://test/backbone.png", methodType: "GET"});
    var query3 = new _ch.AjaxWidget(func, {url: "http://test/ember.png", methodType: "GET"});
    var list = [];
    list.push(query1);
    list.push(query3);
    list.push(query2);
    var chain = new _ch.AjaxChain();
    chain.add(list);
    $.mockjax({
            url: "http://test/angular.png",
            responseText: {img: ""},
            status: 200,
            responseTime: 6000,
            isTimeout: false,
            statusText: "OK",
            proxy: '',
            lastModified: null,
            etag: ''
    });
    $.mockjax({
            url: "http://test/backbone.png",
            responseText: {img: ""},
            status: 200,
            responseTime: 6000,
            isTimeout: false,
            statusText: "OK",
            proxy: '',
            lastModified: null,
            etag: ''
     });

     $.mockjax({
            url: "http://test/ember.png",
            responseText: {img: ""},
            status: 200,
            responseTime: 6000,
            isTimeout: false,
            statusText: "OK",
            proxy: '',
            lastModified: null,
            etag: ''
     });

    var view = new _ch.AjaxChain.View({controller: chain});
    $('#queries').html(view.el);
    view.render();
    chain.start();
});